import Nav from "../components/Nav";
import styled from "styled-components";

const BgContainer = styled.div`
  display: flex;
  position: fixed;
  justify-content: flex-end;
  height: 100vh;
`;

const Bg = styled.div`
  width: 50vw;
  height: 100%;
  background-color: var(--dark-gray);
`;

function Simulator() {
  return (
    <div>
      <BgContainer>
        <Bg></Bg>
      </BgContainer>
      <Nav />
    </div>
  );
}

export default Simulator;
